class Solution {
    public long beautifulSubstrings(String s, int k) {
        long count = 0;
        int[] freq = new int[2]; // freq[0] for vowels, freq[1] for consonants
        for (int i = 0; i < s.length(); i++) {
            int[] currFreq = new int[2];
            for (int j = i; j < s.length(); j++) {
                // Update current frequency
                char c = s.charAt(j);
                if (c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u') {
                    currFreq[0]++;
                } else {
                    currFreq[1]++;
                }
                // Check if current substring is beautiful
                if (currFreq[0] == currFreq[1] && (currFreq[0] * currFreq[1]) % k == 0) {
                    count++;
                }
            }
        }
        return count;
    }
}
